import React from "react";
import Cards from './Cards'
import Sdata from "./Sdata";


const App = () => (
    <>
        <h1 className="heading_style">List of top 5 movies in 2020 to watch</h1>

        {Sdata.map((val, index) => {
            return (
            <Cards
                key={val.id}
                imgsrc={val.imgsrc}
                title={val.title}
                seriesName={val.seriesName}
                link={val.link}
            />);
        })};
    </>
);
